import React from 'react';

function HelloDiv() {
  return (
    <div>
      <header>
        <h1>Hey guys! I`ma a heather</h1>
        <br></br>
        <h3>Things I like</h3>
      </header>
      <ol>
        <li>Music</li>
        <li>Food</li>
        <li>Travel</li>
      </ol>
    </div>
  );
}

export default HelloDiv;
